INSERT INTO `base_report_model` (`id`, `sql`, `type`, `params`, `title`, `description`, `content`, `config`, `data_source_id`, `is_interface`, `interface_id`) VALUES ('205aae78aa7f4b6e93e0c203eeecb61b', NULL, '6', '', '安全结论任务概述', '安全结论任务概述-关保', '${date}，对关保平台进行了安全能力扫描。共发现台账资产${assetTotal}台，漏洞${vulCount}个，威胁事件${threatEventCount}条，资产风险等级为${riskLevel}。其中发现安全资产${normal}台，风险资产${abnormal}台。通过本次扫描可以看出，平台总体安全能力等级${safetyLevel}。', '{\"interfaceId\":\"1c1f509f-648a-409e-a294-d3n012m2265a\",\"type\":\"6\",\"title\":\"安全结论任务概述\",\"quote\":\"${date}，对关保平台进行了安全能力扫描。共发现台账资产${assetTotal}台，漏洞${vulCount}个，威胁事件${threatEventCount}条，资产风险等级为${riskLevel}。其中发现安全资产${normal}台，风险资产${abnormal}台。通过本次扫描可以看出，平台总体安全能力等级${safetyLevel}。\",\"description\":\"安全结论任务概述-关保\"}', '-3', '1', '1c1f509f-648a-409e-a294-d3n012m2265a');
