INSERT INTO `base_report_model` (`id`, `sql`, `type`, `params`, `title`, `description`, `content`, `config`, `data_source_id`, `is_interface`, `interface_id`) VALUES ('781d66adcccd4b8d91ab27144280acb6', NULL, '7', '', '安全建议', '安全建议-关保', '[{\"text\":\"参考产品提供的漏洞建议和解决方案进行系统安全加固。\"},{\"text\":\"安全加固的方案有加固服务、修改密码为强密码、修改系统或服务配置、打补丁、升级软件版本、合理的安全访问策略（如ip地址端口、访问控制）等，请选择合理的安全解决方案。\"},{\"text\":\"对于关键系统的系统加固，为保证业务系统的连续性，须制定合理的、符合系统特性的加固方案，并且加固方案应通过可行性论证并得到具体的验证。如果必要的话，可以请专门的安全服务机构处理，并和相关厂家进行方案确认。有条件的，也可以通过业务测试环境对加固方案进行评估和检验。\"},{\"text\":\"对于高风险和关键业务的漏洞要及时进行加固处理。目前WEB类应用越来越多，其安全威胁日益加剧，建议采用产品自带的WEB扫描模块配合使用。\"},{\"text\":\"采用本产品进行周期性扫描，定期对资产安全状态进行评估，及时发现漏洞风险，验证安全加固效果。\"},{\"text\":\"及时更新漏洞库（建议每周进行一次升级），能够对最新漏洞包括0day进行发现，应对最新漏洞风险。\"}]', '{\"interfaceId\":\"843r73d6-1426-4ded-a4bd-8089f13ec57b\",\"type\":\"7\",\"title\":\"安全建议\",\"paragraph\":[\"参考产品提供的漏洞建议和解决方案进行系统安全加固。\",\"安全加固的方案有加固服务、修改密码为强密码、修改系统或服务配置、打补丁、升级软件版本、合理的安全访问策略（如ip地址端口、访问控制）等，请选择合理的安全解决方案。\",\"对于关键系统的系统加固，为保证业务系统的连续性，须制定合理的、符合系统特性的加固方案，并且加固方案应通过可行性论证并得到具体的验证。如果必要的话，可以请专门的安全服务机构处理，并和相关厂家进行方案确认。有条件的，也可以通过业务测试环境对加固方案进行评估和检验。\",\"对于高风险和关键业务的漏洞要及时进行加固处理。目前WEB类应用越来越多，其安全威胁日益加剧，建议采用产品自带的WEB扫描模块配合使用。\",\"采用本产品进行周期性扫描，定期对资产安全状态进行评估，及时发现漏洞风险，验证安全加固效果。\",\"及时更新漏洞库（建议每周进行一次升级），能够对最新漏洞包括0day进行发现，应对最新漏洞风险。\"],\"description\":\"安全建议-关保\"}', '-3', '1', '843r73d6-1426-4ded-a4bd-8089f13ec57b');
